import{_ as t,c as a,o as e,V as r,a5 as i,a6 as n}from"./chunks/framework.CZ37UyiD.js";const f=JSON.parse('{"title":"Importera ett projekt till Prodikt","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/funktioner/importera_projekt/index.md","filePath":"documentation/funktioner/importera_projekt/index.md"}'),o={name:"documentation/funktioner/importera_projekt/index.md"},s=r('<h1 id="importera-ett-projekt-till-prodikt" tabindex="-1">Importera ett projekt till Prodikt <a class="header-anchor" href="#importera-ett-projekt-till-prodikt" aria-label="Permalink to &quot;Importera ett projekt till Prodikt&quot;">​</a></h1><h2 id="introduktion" tabindex="-1">Introduktion <a class="header-anchor" href="#introduktion" aria-label="Permalink to &quot;Introduktion&quot;">​</a></h2><p>Prodikt stöttar befintliga processer</p><p>Vi tror verkligen att vi har byggt något bra men vi vet också att dina och ditt team’s befintliga processer är viktiga.</p><p>Vid en import av en IFC-fil (3D-modell) eller en Excel-fil (kalkyl/materiallista) till ett projekt i Prodikt så analyseras den data som importeras och matchas mot antingen produkter eller system som finns i Prodikt. För att få produktspecifik data utan att användaren ska behöva räkna om eller samla in någon data så kan nedan steg följas.</p><h2 id="_1-sakerstall-produtspecifik-data" tabindex="-1">1. Säkerställ produtspecifik data <a class="header-anchor" href="#_1-sakerstall-produtspecifik-data" aria-label="Permalink to &quot;1. Säkerställ produtspecifik data&quot;">​</a></h2><p>Många tillverkare har redan registrerat sina produkter i Prodikt, men för att säkerställa att de produkter som är relevanta för projektet finns tillgängliga så bör en kravställning göras rörande produkternas registrering i Prodikt. På så sätt kan det säkerställas att produktspecifik data finns lättillgängligt.</p><p>Hjälp med kravställningen kan fås genom att läsa: ”Föreskriftstexter – Privat sektor” eller ”Föreskriftstexter – Offentlig sektor”.</p><p>Skulle en produkt sakna visst underlag och det accepteras i exempelvis en upphandling, då kan produkten registreras i Prodikt likväl. Produkten kommer då ha vissa luckor i sitt produktkort, men när produkten läggs till i ett projekt kommer generisk data automatiskt att tilldelas produkten vilket underlättar för användaren.</p><p>Läs mer om produktsidan här: <a href="/documentation/kom_igang/produktsida/">Produktsida</a></p><h2 id="_2-importera-granska-produkter" tabindex="-1">2. Importera &amp; granska produkter <a class="header-anchor" href="#_2-importera-granska-produkter" aria-label="Permalink to &quot;2. Importera &amp; granska produkter&quot;">​</a></h2><p>I ett projekt kan olika typer av filer importeras.</p><p><img src="'+i+'" alt="Importera"></p><p>Om en Excelfil ska importeras kan en standardmall enkelt laddas ner vilken importen stödjer.</p><table><thead><tr><th>ProdiktID</th><th style="text-align:center;">Name</th><th>Manufacturer</th><th>Qty</th><th>Unit</th><th>GTIN</th><th>art_nr</th><th>Floor</th><th>Tags</th><th>Identifier</th><th>Length</th><th>Width</th><th>Height</th><th>Thickness</th><th>Diameter</th><th>Weight</th></tr></thead><tbody><tr><td>xxxxxx</td><td style="text-align:center;">xxxx</td><td>xxxx</td><td>xxx</td><td>xx</td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td><td></td></tr></tbody></table><p>Skulle användaren ingå i en organisationsplan så kan importen konfigureras för att stödja organisationsspecifika Excelmallar. Om en IFC-fil ska importeras så har Prodikt fullt stöd för alla olika modeller.</p><p>Oavsett vad för typ av fil som importeras så matchas <strong>artikelnummer/GTIN/bim-objekt</strong> med produkter i Prodikts databas. I projektet visas i procent mängden produktspecifik data. Därmed är det enkelt att avgöra och upptäcka ifall någon produkt i projektet baseras på generisk data.</p><h2 id="_3-optimera-projektet" tabindex="-1">3. Optimera projektet <a class="header-anchor" href="#_3-optimera-projektet" aria-label="Permalink to &quot;3.	Optimera projektet&quot;">​</a></h2><p>Skulle en import inte ge en fullständig matchning kan detta antingen bero på att produkten fattades i produktdatabasen alternativt att importfilen innehöll bristfällig data, ex. avsaknad av <strong>artikelnummer/GTIN/bim-objekt</strong>.</p><p>I projektet är det enkelt att skilja på generisk och specifik data. Det är även lika enkelt att byta ut en eller flera produkter på en gång.</p><h2 id="_4-analysera-rapportera" tabindex="-1">4. Analysera &amp; rapportera <a class="header-anchor" href="#_4-analysera-rapportera" aria-label="Permalink to &quot;4.	Analysera &amp; rapportera&quot;">​</a></h2><p>När projektet är fullständigt kan en analys enkelt göras utifrån sammanställningen som finns för klimatpåverkan, cirkularitet och hälsa/material i projektvyn. En projektrapport kan skapas samt att en klimatdeklaration kan upprättas om det kravet skulle finnas.</p><p><img src="'+n+'" alt="Importera"></p>',23),l=[s];function d(p,k,m,h,u,c){return e(),a("div",null,l)}const _=t(o,[["render",d]]);export{f as __pageData,_ as default};
